import React from "react";

function HomePage() {
  return (
    <>
      <div className="jumbotron">
        <h1>Ashray Chowdhry</h1>
        <p>Computer Science Student at Georgia Tech</p>
      </div>
      <div>
        <p>Here are some of my past projects:</p>
        <p>Autonomous Robotic Arm</p>
        <p>Autonomous Electric Vehicle</p>
        <p>FoodSplash</p>
        <p>SplitWay</p>
        <p>This Website! Using React.js, Bootstrap, JavaScript</p>
      </div>
    </>
  );
}

export default HomePage;
